import React from "react"
import { makeStyles } from '@material-ui/core/styles';


import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Button from '@material-ui/core/Button';
// import Paper from '@material-ui/core/Paper';
// import Grid from '@material-ui/core/Grid';
import {Link} from "react-router-dom"






const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,

  },
  menuButton: {
    marginLeft: theme.spacing(2),


  },
  title: {
    flexGrow: 1,

  },
}));


export default function ButtonAppBar() {
  const classes = useStyles()

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" className={classes.title}>
            News
          </Typography >
          <div style={{paddingLeft: "20px"}}>
          <Button style={{background: "none"}} variant="outlined" color="#1c54b2"><Link style={{textDecoration: "none"}} to="/Home">Home</Link></Button>

       <Button variant="outlined" style={{background: "none"}} color="#ede7f6"><Link style={{textDecoration: "none"}} to="About">About</Link></Button>


          <Button variant="outlined" style={{background: "none"}} color="#1c54b2"><Link style={{textDecoration: "none"}} to="User">User</Link></Button>

          </div>






        </Toolbar>
      </AppBar>



    </div>


  );
}
